import React from 'react'
import { header__logo } from './header.css'

import logoMain from '../../assets/img/FP-13.png'

const Header = () => {

    return (
            <header>
                  <div className={header__logo}>
                    <img src={logoMain} alt="Fragment Pur logo"/>
                  </div>
            </header>
    )
}

export default Header
